import React from 'react';
import { SizeMe } from 'react-sizeme'

const Mycomponent=()=> {
  return (
    <SizeMe>
      {({size}) => <div>My width is {size.width}px</div>}
    </SizeMe>
  )
}

export default Mycomponent;
